        <div className='flex justify-center'>
        <header class=" text-white h-auto">
          <LeftBar />
        </header>
        <main role="main">
          <div class="md:flex md:w-[990px] w-[500px]">
            <section class="w-3/5 border border-y-0 border-gray-800" >
            </section>  
          </div>
        </main>
        </div>
      </div>
    </body>
  );
}

export default App;
